import { Link } from "react-router-dom";

const Nav = () => {

    return (
        <>
        <nav>
            <Link to="/"> Home </Link>
            <Link to="/gallery"> Gallery </Link>
            <Link to="/cutest"> Cutest </Link>
        </nav>
        </>
    )
}

export default Nav;
